import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import GrievanceForm from '../components/GrievanceForm';

const Grievance = () => {
  return (
    <div>
      <Navbar />
      <h1>Submit Grievance</h1>
      <GrievanceForm />
      <Footer />
    </div>
  );
};

export default Grievance;
